-risk\" target=\"_blank\" rel=\"noreferrer noopener\">certain fruit or vegetable</a>s into the grounds, you <strong>must not</strong> take them back out again; please consume them on site or dispose of them in dedicated bins provided at:</p><ul><li> Main Gate  North Terrace entrance</li><li> Friends Gate  Botanic Park entrance</li><li> Mulberry Arbour - by the restaurant lawn, west of Ficus Avenue</li><li> Humpback Bridge  over the Main Lake</li></ul>\n<p>Please <strong>do not</strong> use the general waste bins for at-risk fruit or vegetables. </p>\n<p>Visit <strong><a href=\"https://fruitfly.sa.gov.au/\" target=\"_blank\" rel=\"noreferrer noopener\">fruitfly.sa.gov.au</a> </strong>or call the Fruit Fly Hotline <strong>1300 666 010</strong></p>\n<p>Thank you for your cooperation. The <a href=\"https://fruitfly.sa.gov.au/identify-fruit-fly/why-keep-sa-fruit-fly-free\" target=\"_blank\" rel=\"noreferrer noopener\">impact</a> of the current fruit fly outbreaks is in your hands.</p><h2>Hours</h2>\n<p>Adelaide Botanic Garden is open every day of the year, including public holidays.</p><table><tbody><tr><th>Opening times</th><th>Closing times</th></tr><tr><td><p><strong>Monday - Friday</strong><br />7:15am (all year)</p>\n<p><strong>Weekends and public holidays</strong><br />7.15am (Dec to Mar)<br />9:00am (Apr to Nov)</p></td><td><p><strong>December to March</strong><br />7:00pm (Mon to Wed)<br />9.00pm (Thu to Sun)</p>\n<p><strong>April</strong><br />6.30pm</p>\n<p><strong>May to August<br /></strong>5.30pm</p>\n<p><strong>September to November</strong><br />6.30pm</p></td></tr></tbody></table><h2>Admission</h2>\n<p>Free</p><h2>Location and Map</h2>\n<p>North Terrace, Adelaide, SA 5000, Australia.</p>\n<p><a title=\"bgsa-adelaide-botanic-garden-visitor-brochure-0615\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/bgsa-adelaide-botanic-garden-visitor-brochure-0516.pdf\"></a><a title=\"BG101_ABG_brochure_2019.pdf\" href=\"https://ww