td><td>$0.70</td><td>Free</td></tr><tr><td>6 </td><td>10 hours </td><td>$3.80 or <br />$10.00 flat fee</td><td>$0.70</td><td>Free</td></tr><tr><td>7 State Herbarium car park (Next to the Rose Garden)</td><td><p>4 hours</p>\n<p>10 hours</p></td><td><p>$3.80 or </p>\n<p>$25.00 flat fee</p></td><td> $0.70</td><td>Free</td></tr><tr><td><p>8 Goodman Building carpark (Directly north of the National Wine Centre)</p></td><td>4 hours</td><td>$3.80</td><td> $0.70</td><td>Free</td></tr></tbody></table>\n<p>Bus layover zones and loading zones are available in zone 4 for drop off. For longer parking, please contact <a href=\"https://www.botanicgardens.sa.gov.au/contact-us/general-enquiries\">reception</a>.</p>\n<p>Parking fees apply from 8am - 6pm on Monday - Saturday.</p>\n<p>There is free parking on Sundays and public holidays.</p>\n<p>Accessible parking spaces are available within all 4-hour parking zones and are free of charge for people displaying a disability parking permit. For visits longer than 4 hours, permit holders are welcome to park in 10 hour bays, and can pay half the ticketed price for the duration of the stay.</p>\n<p><a title=\"Car Parking information for Adelaide Botanic Garden and Botanic Park\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/car_parking_at_adelaide_botanic_garden_and_botanic_park.pdf\">Find out more</a> about parking at Adelaide Botanic Garden and Botanic Park.</p>\n<p>See the <a title=\"Adelaide Botanic Garden and Botanic Park car parking map\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/abg_and_botanic_park_car_parking_map.pdf\">car parking map</a> for more information on where to park and zones.</p>\n\n<p><strong>Adelaide Botanic Garden parking machine fault - 4 March 2021</strong></p>\n<p>We are aware there is currently a fault with some of our parking machines. If you have been impacted, we take this opportunity to assure you that we are working with the software provider to fix the problem and any overcharge will be refunded in as soon as possible. In the meantime, if you require any further information please do not hesitate to contact the Botanic Gardens and State Herbarium administration team on 08 8222 9311 or by <a href=\"mailto:botanicgardens@sa.gov.au\">email here</a>. </p>\n<h2>Accessibility</h2>\n<p>Adelaide Botanic Garden is easy to access from all gates and navigate with paved and bitumen paths running throughout the Garden.</p>\n<p>Wheelchairs are available to hire (Monday to Friday) from reception in the Goodman Building on Hackney Road, however they must be pre-booked.</p>\n<p>For more information or to book please call 08 8222 9311.</p>\n<h2>Regulations</h2>\n<p>Botanic gardens are different from public parks in that they\'re living museums, filled with valuable living collections. For this reason some activities - such as allowing dogs to roam the Garden - have the potential to damage or destroy valuable plants.</p>\n<p>Botanic Gardens are also internationally-regarded as places for visitors to seek peace beauty and tranquillity, so activities that impede this (such as the use of drones) are also discouraged. You must not:</p><ul><li>Bring <strong>dogs</strong> or other pets into the Garden</li><li>Fly <strong>drones</strong> in or above the Garden (under <a href=\"https://www.casa.gov.au/\" target=\"_blank\" rel=\"noreferrer noopener\">CASA</a> guidelines. Learn more at our <a href=\"http://www.environment.sa.gov.au/botanicgardens/contact-us/filming-photography\" target=\"_blank\" rel=\"noreferrer noopener\">Filming and Photography</a> page)</li><li>Ride <strong>bikes / bicycles</strong>, scooters, skateboards or rollerblades</li><li>Drive <strong>vehicles</strong> into the Garden</li><li>Damage or remove plants</li><li>Enter garden beds</li><li>Bring <strong>alcohol</strong> into the Garden</li><li>Play ball or throwing games</li><li>Bring <strong>BBQs</strong> into the Garden</li></ul>\n<h2>Wildlife</h2>\n<p>The Botanic Gardens of South Australia are home to a huge variety of bird and animal life that are attracted to the Gardens flora. We do, however, ask that you do not feed the wildlife. <a href=\"https://www.botanicgardens.sa.gov.au/visit/wildlife\">Find out more about animal welfare and the Botanic Gardens of South Australia</a>.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(193,302,1,'Landing page','2021-06-04 08:38:27','2021-06-04 08:38:27','7162f40d-7fb6-4d1b-9977-93b1fd562d11',NULL,NULL,'Visit',NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(194,303,1,'General content page','2021-06-04 08:39:01','2021-06-04 08:39:01','2ba380c3-a94d-4e52-9d09-514ac9591719',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[\"callToActions\",\"location\",\"recentPosts\"]',NULL),(195,304,1,NULL,'2021-06-04 08:39:01','2021-06-04 08:39:01','3a34d113-7fa7-4d61-8d61-b88ecbcbb984',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Video title','https://youtu.be/U8RPK4mboKE',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(196,305,1,NULL,'2021-06-04 08:39:01','2021-06-04 08:39:01','e10d8413-5cb6-48a3-a0ba-eba362567c7f',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p><strong><a href=\"http://www.environment.sa.gov.au/botanicgardens/whats-on\" target=\"_blank\" rel=\"noreferrer noopener\">See \'What\'s On\' in the garden here.</a></strong></p><h2><a href=\"http://www.environment.sa.gov.au/botanicgardens/whats-on\" target=\"_blank\" rel=\"noreferrer noopener\"></a>Fruit fly outbreak</h2>\n<p>Adelaide Botanic Garden and Botanic Park are now in a <strong><a href=\"https://fruitfly.sa.gov.au/outbreak-restrictions/red-area\" target=\"_blank\" rel=\"noreferrer noopener\">fruit fly red outbreak area</a></strong>. </p>\n<p>While the flies themselves will not affect you on your visit, it may impact what food you choose to bring to the garden or park.</p>\n<p>If you bring <a href=\"https://fruitfly.sa.gov.au/outbreak-restrictions/fruit-and-vegetables-at-risk\" target=\"_blank\" rel=\"noreferrer noopener\">certain fruit or vegetable</a>s into the grounds, you <strong>must not</strong> take them back out again; please consume them on site or dispose of them in dedicated bins provided at:</p><ul><li> Main Gate  North Terrace entrance</li><li> Friends Gate  Botanic Park entrance</li><li> Mulberry Arbour - by the restaurant lawn, west of Ficus Avenue</li><li> Humpback Bridge  over the Main Lake</li></ul>\n<p>Please <strong>do not</strong> use the general waste bins for at-risk fruit or vegetables. </p>\n<p>Visit <strong><a href=\"https://fruitfly.sa.gov.au/\" target=\"_blank\" rel=\"noreferrer noopener\">fruitfly.sa.gov.au</a> </strong>or call the Fruit Fly Hotline <strong>1300 666 010</strong></p>\n<p>Thank you for your cooperation. The <a href=\"https://fruitfly.sa.gov.au/identify-fruit-fly/why-keep-sa-fruit-fly-free\" target=\"_blank\" rel=\"noreferrer noopener\">impact</a> of the current fruit fly outbreaks is in your hands.</p><h2>Hours</h2>\n<p>Adelaide Botanic Garden is open every day of the year, including public holidays.</p><table><tbody><tr><th>Opening times</th><th>Closing times</th></tr><tr><td><p><strong>Monday - Friday</strong><br />7:15am (all year)</p>\n<p><strong>Weekends and public holidays</strong><br />7.15am (Dec to Mar)<br />9:00am (Apr to Nov)</p></td><td><p><strong>December to March</strong><br />7:00pm (Mon to Wed)<br />9.00pm (Thu to Sun)</p>\n<p><strong>April</strong><br />6.30pm</p>\n<p><strong>May to August<br /></strong>5.30pm</p>\n<p><strong>September to November</strong><br />6.30pm</p></td></tr></tbody></table><h2>Admission</h2>\n<p>Free</p><h2>Location and Map</h2>\n<p>North Terrace, Adelaide, SA 5000, Australia.</p>\n<p><a title=\"bgsa-adelaide-botanic-garden-visitor-brochure-0615\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/bgsa-adelaide-botanic-garden-visitor-brochure-0516.pdf\"></a><a title=\"BG101_ABG_brochure_2019.pdf\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/bgsh_abg_brochure_2019.pdf\" target=\"_blank\" rel=\"noreferrer noopener\"></a><a title=\"BG101_ABG_brochure_2019_FIN_web_layout.pdf\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/bgsh_abg_brochure_2019.pdf\"></a><a title=\"BGSH_ABG_brochure_2019.pdf\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/bgsh_abg_brochure_2019.pdf\"></a><a title=\"Adelaide Botanic Garden Brochure and Map\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/abg_brochure_2019.pdf\">Download the Adelaide Botanic Garden map and brochure.</a></p>\n<p>Entrances: North Terrace, Plane Tree Drive, Hackney Road and Frome Road.</p><h2>Getting there</h2>\n<p>Adelaide Botanic Garden has a tram stop outside its Main Gate on North Terrace, called Botanic Gardens. </p>\n<p>The garden can also be accessed by bus. Please check <a href=\"http://adelaidemetro.com.au/\" target=\"_blank\" rel=\"noreferrer noopener\">Adelaide Metro</a> for public transport services into the city centre.</p><h2>Parking</h2>\n<p>Ticketed car parking is available on Plane Tree Drive and in front of the Goodman Building and State Herbarium (in front of the Rose Garden, closest to the Hackney Gate marked as C17 on the map). Both car parks are accessed from Hackney Road. </p>\n<p>Ticket machines accept credit or debit cards and coins (excluding 5 and 10 cent coins).</p>\n<p>Funds collected from ticketed parking directly support the Gardens world-class botanical collections and education and conservation programs.</p><table><tbody><tr><td>Zone</td><td>Duration</td><td>Rate<br />Mon-Fri per hour</td><td>Rate<br />Sat per hour</td><td>Rate<br />Sun and public holidays</td></tr><tr><td>Plane Tree Drive = Zones 1-6</td><td></td><td></td><td></td><td></td></tr><tr><td>1</td><td>10 hours</td><td>$3.80</td><td>$0.70</td><td>Free</td></tr><tr><td>2-5</td><td>4 hours</td><td>$3.80</td><td>$0.70</td><td>Free</td></tr><tr><td>6</td><td>10 hours</td><td>$3.80 or <br />$10.00 flat fee</td><td>$0.70</td><td>Free</td></tr><tr><td>7 State Herbarium car park (Next to the Rose Garden)</td><td><p>4 hours</p>\n<p>10 hours</p></td><td><p>$3.80 or </p>\n<p>$25.00 flat fee</p></td><td>$0.70</td><td>Free</td></tr><tr><td><p>8 Goodman Building carpark (Directly north of the National Wine Centre)</p></td><td>4 hours</td><td>$3.80</td><td>$0.70</td><td>Free</td></tr></tbody></table>\n<p>Bus layover zones and loading zones are available in zone 4 for drop off. For longer parking, please contact <a href=\"https://www.botanicgardens.sa.gov.au/contact-us/general-enquiries\">reception</a>.</p>\n<p>Parking fees apply from 8am - 6pm on Monday - Saturday.</p>\n<p>There is free parking on Sundays and public holidays.</p>\n<p>Accessible parking spaces are available within all 4-hour parking zones and are free of charge for people displaying a disability parking permit. For visits longer than 4 hours, permit holders are welcome to park in 10 hour bays, and can pay half the ticketed price for the duration of the stay.</p>\n<p><a title=\"Car Parking information for Adelaide Botanic Garden and Botanic Park\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/car_parking_at_adelaide_botanic_garden_and_botanic_park.pdf\">Find out more</a> about parking at Adelaide Botanic Garden and Botanic Park.</p>\n<p>See the <a title=\"Adelaide Botanic Garden and Botanic Park car parking map\" href=\"https://www.botanicgardens.sa.gov.au/files/sharedassets/botanic_gardens/visit/abg_and_botanic_park_car_parking_map.pdf\">car parking map</a> for more information on where to park and zones.</p>\n<p><strong>Adelaide Botanic Garden parking machine fault - 4 March 2021</strong></p>\n<p>We are aware there is currently a fault with some of our parking machines. If you have been impacted, we take this opportunity to assure you that we are working with the software provider to fix the problem and any overcharge will be refunded in as soon as possible. In the meantime, if you require any further information please do not hesitate to contact the Botanic Gardens and State Herbarium administration team on 08 8222 9311 or by <a href=\"mailto:botanicgardens@sa.gov.au\">email here</a>. </p><h2>Accessibility</h2>\n<p>Adelaide Botanic Garden is easy to access from all gates and navigate with paved and bitumen paths running throughout the Garden.</p>\n<p>Wheelchairs are available to hire (Monday to Friday) from reception in the Goodman Building on Hackney Road, however they must be pre-booked.</p>\n<p>For more information or to book please call 08 8222 9311.</p><h2>Regulations</h2>\n<p>Botanic gardens are different from public parks in that they\'re living museums, filled with valuable living collections. For this reason some activities - such as allowing dogs to roam the Garden - have the potential to damage or destroy valuable plants.</p>\n<p>Botanic Gardens are also internationally-regarded as places for visitors to seek peace beauty and tranquillity, so activities that impede this (such as the use of drones) are also discouraged. You must not:</p><ul><li>Bring <strong>dogs</strong> or other pets into the Garden</li><li>Fly <strong>drones</strong> in or above the Garden (under <a href=\"https://www.casa.gov.au/\" target=\"_blank\" rel=\"noreferrer noopener\">CASA</a> guidelines. Learn more at our <a href=\"http://www.environment.sa.gov.au/botanicgardens/contact-us/filming-photography\" target=\"_blank\" rel=\"noreferrer noopener\">Filming and Photography</a> page)</li><li>Ride <strong>bikes / bicycles</strong>, scooters, skateboards or rollerblades</li><li>Drive <strong>vehicles</strong> into the Garden</li><li>Damage or remove plants</li><li>Enter garden beds</li><li>Bring <strong>alcohol</strong> into the Garden</li><li>Play ball or throwing games</li><li>Bring <strong>BBQs</strong> into the Garden</li></ul><h2>Wildlife</h2>\n<p>The Botanic Gardens of South Australia are home to a huge variety of bird and animal life that are attracted to the Gardens flora. We do, however, ask that you do not feed the wildlife. <a href=\"https://www.botanicgardens.sa.gov.au/visit/wildlife\">Find out more about animal welfare and the Botanic Gardens of South Australia</a>.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(197,306,1,'Kitchen sink','2021-06-04 08:39:44','2021-06-04 08:39:44','b489cf36-706a-4011-b5d7-3d2287c9b172',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[]',NULL),(198,307,1,NULL,'2021-06-04 08:39:45','2021-06-04 08:39:45','f5900a9a-35d6-497c-8ea9-45f7bf9ff6c2',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'<p>Can you please send me the design specs again? can we have another option I really like the colour but can you change it. Start on it today and we will talk about what i want next time i love it, but can you invert all colors? i know you\'ve made thirty iterations but can we go back to the first one that was the best version, nor that\'s going to be a chunk of change. Can you make it look like this clipart i found we have big contacts we will promote you, and that\'s great, but can you make it work for ie 2 please. Can you make the logo bigger yes bigger bigger still the logo is too big are you busy this weekend? I have a new project with a tight deadline that sandwich needs to be more playful can you help me out? you will get a lot of free exposure doing this. Needs to be sleeker submit your meaningless business jargon to be used on the site!, yet thanks for taking the time to make the website, but i already made it in wix.<br /><br />I\'ll pay you in a week we don\'t need to pay upfront i hope you understand I know somebody who can do this for a reasonable cost I really think this could go viral, nor can my website be in english?, low resolution? It looks ok on my screen i was wondering if my cat could be placed over the logo in the flyer. What is a hamburger menu what you\'ve given us is texty, we want sexy could you solutionize that for me that\'s going to be a chunk of change nor start on it today and we will talk about what i want next time or you might wanna give it another shot. I really like the colour but can you change it. You are lucky to even be doing this for us can\'t you just take a picture from the internet? can you put \"find us on facebook\" by the facebook logo? so can you make it look more designed yet this looks perfect. Just Photoshop out the dog, add a baby, and make the curtains blue we have big contacts we will promote you. Can you make the blue bluer? can you help me out? you will get a lot of free exposure doing this can you make the font bigger? I want you to take it to the next level can you put \"find us on facebook\" by the facebook logo?, we are a startup. I need a website. How much will it cost. Can you punch up the fun level on these icons just do what you think. I trust you could you do an actual logo instead of a font, or that\'s great, but can you make it work for ie 2 please. What you\'ve given us is texty, we want sexy. Doing some work for us \"pro bono\" will really add to your portfolio i promise the hair is just too polarising can the black be darker. Make it sexy can you make the font bigger? so can you make pink a little more pinkish that\'s great, but we need to add this 2000 line essay. In an ideal world can you make it look like this clipart i found. What is a hamburger menu can you put \"find us on facebook\" by the facebook logo?. Could you rotate the picture to show the other side of the room? can you make the font bigger?. That\'s going to be a chunk of change can you make it look like this clipart i found.</p>',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(199,308,1,NULL,'2021-06-04 08:39:45','2021-06-04 08:39:45','b3f28d64-eb9f-4472-80a5-ec5addedb732',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(200,309,1,NULL,'2021-06-04 08:39:45','2021-06-04 08:39:45','67085592-6ffd-42e0-8c19-ebaede3c1d6c',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'Video title','https://www.youtube.com/watch?v=000al7ru3ms',NULL,NULL,NULL,NULL,NULL,NULL,NULL),(201,310,1,NULL,'2021-06-04 08:41:29','2021-06-04 08:41:29','1c8fcf27-90a5-459d-bc83-84d7919a45ea',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\n<p>Weve had wonderful success in the kitchen garden with lots of produce, including <strong>turnips</strong>, <strong>swedes</strong> and different varieties of <strong>kale</strong>. </p>\n<p>In the smaller raised beds the <strong>turmeric</strong> is growing handsomely. The <strong>capers</strong> have spread, and in the first bed we have planted <strong>ginger, galamgal</strong> and <strong>Japanese ginger</strong> (you eat the flower and not the root!)</p>\n<p>Schools and kindergartens have had a wonderful time harvesting these and taking them back to school to cook with.</p><h2><strong>Tips on how you can keep your kitchen garden thriving this autumn.</strong></h2>\n<h3>Water, water, water! </h3>\n<p>Even though we may have had some rain, fruit trees (especially citrus) need about 200 litres or more of water per week.</p>\n<p>How do you achieve the right amount? Well, time how long it takes to fill up a standard sized bucket or watering can (which hold around 9-10 litres). You can then work out how long it will take to get 200 litres of water into the ground at that hose flow rate. Or give yourself a bit of a work out by re-filling the watering can 20 times! </p>\n<p>It is better to treat the roots to a deep water twice a week than lots of small surface waters, and don\'t forget to water your other crops too. Even without 20-30 degree days, they will still get thirsty.</p>\n<h3>Pests</h3>\n<p>Pesky pests can be problematic on veggies, including kale. Although we had a great crop this year, we can\'t say the same for last year when we had a huge problem with <strong>white fly</strong>.</p>\n<p>To help combat this in an environmentally friendly way, this year we planted <strong>amaranth</strong>, garlic and garlic onions around the kale crops (see below). We think these plants have kept the white fly at bay.</p>\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(202,311,1,'Little sprouts article','2021-06-04 08:41:29','2021-06-04 08:41:29','e872f181-d468-4dab-b173-ea844b1a187b',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,0,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'[]',NULL),(203,312,1,NULL,'2021-06-04 08:41:29','2021-06-04 08:41:29','afc133d9-2362-43a6-9384-2e0c1f519e26',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'\n<p>Weve had wonderful success in the kitchen garden with lots of produce, including <strong>turnips</strong>, <strong>swedes</strong> and different varieties of <strong>kale</strong>. </p>\n<p>In the smaller raised beds the <strong>turmeric</strong> is growing handsomely. The <strong>capers</strong> have spread, and in the first bed we have planted <strong>ginger, galamgal</strong> and <strong>Japanese ginger</strong> (you eat the flower and not the root!)</p>\n<p>Schools and kindergartens have had a wonderful time harvesting these and taking them back to school to cook with.</p><h2><strong>Tips on how you can keep your kitchen garden thriving this autumn.</strong></h2>\n<h3>Water, water, water! </h3>\n<p>Even though we may have had some rain, fruit trees (especially citrus) need about 200 litres or more of water per week.</p>\n<p>How do you achieve the right amount? Well, time how long it takes to fill up a standard sized bucket or watering can (which hold around 9-10 litres). You can then work out how long it will take to get 200 litres of water into the ground at that hose flow rate. Or give yourself a bit of a work out by re-filling the watering can 20 times! </p>\n<p>It is better to treat the roots to a deep water twice a week than lots of small surface waters, and don\'t forget to water your other crops too. Even without 20-30 degree days, they will still get thirsty.</p>\n<h3>Pests</h3>\n<p>Pesky pests can be problematic on veggies, including kale. Although we had a great crop this year, we can\'t say the same for last year when we had a huge problem with <strong>white fly</strong>.</p>\n<p>To help combat this in an environmentally friendly way, this year we planted <strong>amaranth</strong>, garlic and garlic onions around the kale crops (see below). We think these plants have kept the white fly at bay.</p>\n',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);
