y hotline 1300 666 010 thank you for your cooperation the impact of the current fruit fly outbreaks is in your hands hours adelaide botanic garden is open every day of the year including public holidays opening times closing times monday friday 7 15am all year weekends and public holidays 7 15am dec to mar 9 00am apr to nov december to march 7 00pm mon to wed 9 00pm thu to sun april 6 30pm may to august 5 30pm september to november 6 30pm admission free location and map north terrace adelaide sa 5000 australia download the adelaide botanic garden map and brochure entrances north terrace plane tree drive hackney road and frome road getting there adelaide botanic garden has a tram stop outside its main gate on north terrace called botanic gardens the garden can also be accessed by bus please check adelaide metro for public transport services into the city centre parking ticketed car parking is available on plane tree drive and in front of the goodman building and state herbarium in front of the rose garden closest to the hackney gate marked as c17 on the map both car parks are accessed from hackney road ticket machines accept credit or debit cards and coins excluding 5 and 10 cent coins funds collected from ticketed parking directly support the gardens world class botanical collections and education and conservation programs zone duration rate mon fri per hour rate sat per hour rate sun and public holidays plane tree drive = zones 1 6 1 10 hours $3 80 $0 70 free 2 5 4 hours $3 80 $0 70 free 6 10 hours $3 80 or $10 00 flat fee $0 70 free 7 state herbarium car park next to the rose garden 4 hours 10 hours $3 80 or $25 00 flat fee $0 70 free 8 goodman building carpark directly north of the national wine centre 4 hours $3 80 $0 70 free bus layover zones and loading zones are available in zone 4 for drop off for longer parking please contact reception parking fees apply from 8am 6pm on monday saturday there is free parking on sundays and public holidays accessible parking spaces are available within all 4 hour parking zones and are free of charge for people displaying a disability parking permit for visits longer than 4 hours permit holders are welcome to park in 10 hour bays and can pay half the ticketed price for the duration of the stay find out more about parking at adelaide botanic garden and botanic park see the car parking map for more information on where to park and zones adelaide botanic garden parking machine fault 4 march 2021 we are aware there is currently a fault with some of our parking machines if you have been impacted we take this opportunity to assure you that we are working with the software provider to fix the problem and any overcharge will be refunded in as soon as possible in the meantime if you require any further information please do not hesitate to contact the botanic gardens and state herbarium administration team on 08 8222 9311 or by email here accessibility adelaide botanic garden is easy to access from all gates and navigate with paved and bitumen paths running throughout the garden wheelchairs are available to hire monday to friday from reception in the goodman building on hackney road however they must be pre booked for more information or to book please call 08 8222 9311 regulations botanic gardens are different from public parks in that theyre living museums filled with valuable living collections for this reason some activities such as allowing dogs to roam the garden have the potential to damage or destroy valuable plants botanic gardens are also internationally regarded as places for visitors to seek peace beauty and tranquillity so activities that impede this such as the use of drones are also discouraged you must not bring dogs or other pets into the garden fly drones in or above the garden under casa guidelines learn more at our filming and photography page ride bikes bicycles scooters skateboards or rollerblades drive vehicles into the garden damage or remove plants enter garden beds bring alcohol into the garden play ball or throwing games bring bbqs into the garden wildlife the botanic gardens of south australia are home to a huge variety of bird and animal life that are attracted to the gardens flora we do however ask that you do not feed the wildlife find out more about animal welfare and the botanic gardens of south australia '),(249,'slug',0,1,' general content page '),(249,'title',0,1,' general content page '),(250,'field',33,1,' video title '),(250,'slug',0,1,''),(251,'field',32,1,' see whats on in the garden here fruit fly outbreak adelaide botanic garden and botanic park are now in a fruit fly red outbreak area while the flies themselves will not affect you on your visit it may impact what food you choose to bring to the garden or park if you bring certain fruit or vegetable s into the grounds you must not take them back out again please consume them on site or dispose of them in dedicated bins provided at main gate north terrace entrance friends gate botanic park entrance mulberry arbour by the restaurant lawn west of ficus avenue humpback bridge over the main lake please do not use the general waste bins for at risk fruit or vegetables visit fruitfly sa gov au or call the fruit fly hotline 1300 666 010 thank you for your cooperation the impact of the current fruit fly outbreaks is in your hands hours adelaide botanic garden is open every day of the year including public holidays opening times closing times monday friday 7 15am all year weekends and public holidays 7 15am dec to mar 9 00am apr to nov december to march 7 00pm mon to wed 9 00pm thu to sun april 6 30pm may to august 5 30pm september to november 6 30pm admission free location and map north terrace adelaide sa 5000 australia download the adelaide botanic garden map and brochure entrances north terrace plane tree drive hackney road and frome road getting there adelaide botanic garden has a tram stop outside its main gate on north terrace called botanic gardens the garden can als